function Navbar() {
    return (

        <Router>
            <div className="navBar">
            <ul className='nav-links'>
                <li> 
                    <Link to='/tracker'>Tracker</Link>
                </li>
                <li> 
                    <Link to='/login'>Login</Link>
                </li>
            </ul>

            <Switch>
                <Route path="/" exact/>
                <Route path="/tracker" component={Tracker}/>
                <Route path="/login" component={Login}/>
            </Switch>
            </div>
        </Router>
    )
}



export default Navbar;
